import { StyleSheet } from 'react-native';

var styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 24,
      backgroundColor: '#a9a9a9',
      alignItems: 'center',
      justifyContent: 'center',
    },
    title: {
      marginTop: 16,
      paddingVertical: 8,
      borderWidth: 1,
      borderColor: "#20232a",
      borderRadius: 6,
      backgroundColor: "#821426",
      color: "#20232a",
      textAlign: "center",
      fontSize: 30,
      fontWeight: "bold"
    },

    button: {
      height: 20,
      width: 5,
      marginTop: 10,
      padding: 100,
      justifyContent: 'center',
      backgroundColor: 'red',
      alignContent: 'center',
      flexDirection: 'row'
    
    }
  });

  export default styles;
